       "full_text": "Aaron Rodgers took the classy way out after his long-awaited trade to the New York Jets went through Monday. The now-former Green Bay Packers quarterback posted a lengthy farewell letter to Instagram on Tuesday, thanking the Packers organization and fan base after 18 years, along with photos documenting his journey from draft pick to four-time MVP. He ended the message by saying he will see Green Bay again and will always feel a connection to the city: \"This is not the end for us, I will see you again Green Bay, you\u2019ll always have my heart.\"      View this post on Instagram       A post shared by Aaron Rodgers (@aaronrodgers12) Rodgers mentioned 40 different people by name in the farewell, including former general manager Ted Thompson, former head coach Mike McCarthy, current head coach Matt LaFleur and several members of the coaching staff, training staff and PR team. As Rodgers has done in the past, many are referred to by nicknames. The 39-year-old quarterback even shouted out current Packers general manager Brian Gutekunst, a man he has been rumored to have feuded with in recent years. No current or former Packers players are mentioned by name, with Rodgers instead thanking them all. One of Rodgers' best friends on the Packers, left tackle David Bakhtiari, posted his own goodbye hours before, complete with Nickelback musical accompaniment. Rodgers' goodbye is a nice gesture given how tenuous his time in Green Bay was in his later years and how protracted his exit became. After multiple offseasons of retirement and trade speculation (including an actual trade demand in 2021), Rodgers announced March 15 that he planned to play for the Jets next season. It took more than a month for the Packers and Jets to actually reach a deal. The end result is Rodgers heading to New York in exchange for a swap of first-round picks, a second-round pick and a sixth-round pick in 2023, plus another second-round pick in 2024 that becomes a first-rounder if Rodgers players 65% of the Jets' offensive snaps next season. The Jets also receive a fifth-round pick in the 2023 NFL Draft, which begins Thursday. Rodgers joins a Jets team with enormous expectations. The franchise went 7-10 last season and looked competent at times despite ranking last in the NFL in passer rating, and it's now adding the second-most efficient quarterback in NFL history by that same metric. Thank you. \u2764\ufe0f I\u2019m not sure it\u2019s possible to fully express the gratitude that I have to the @packers , our incredible fans, the state of Wisconsin, the thousands of players that I crossed paths with, the incredible men and women who work for the organization, and the amazing people who I got to meet along the way, in one post with 10 pictures, but I hope you read this and feel my heart and soul, filled with love, joy, and peace about my time in green and gold. \ud83d\udc9a\ud83d\udc9b I grew up in Green Bay, drafted at 21, fell in love with the game, met some lifelong friends, and take with me memories that will last a lifetime. I\u2019m grateful to the late Ted Thompson for drafting me, for my head coaches, especially the 13 years with Mike McCarthy, and the last 4 with Matt LaFleur. I had some incredible men to work with in the QB room over the years including Tom, AVP, Luke, and Connor. Huge thank you to my guys in the equipment room, Red, TBone, Odea, Kev, Bryan, Andy Grouber, All my dear friends in the training room over the years, Nate, Flea, Doc McKenzie, Doc Gray, Pepp, and Cuz. The legendary Adam Korzun and his incredible staff; Dougie, Crabby, and Scotty, for always looking out for me; Tom, Nate, Sarah, and Jason in PR, Evan for bringing my work life to film, The Rock and Wayne, for giving words to the highlights of my career, Grey, and Big Rob for your work with our guys over the years, Bloke, Thad, Grant and Gizz in the weight room, Bob Harlan, Russ Ball, Mark Murphy and Brian Gutekunst for your stewardship of the organization, every one on the 3rd and 4th floors who make that building run smoothly, and so many countless others at the loading dock, tours, concessions, maintenance, our field crew, etc. To the fans, THANK YOU, you made every run out of the tunnel special, every home game magical, and it was my honor to be your QB. To my teammates, I love you all, and am thankful for the moments on and off the field that brought us close. I played with legends, I played with friends; thanks for believing in me and having my back always \u2764\ufe0f This is not the end for us, I will see you again Green Bay, you\u2019ll always have my heart \u2764\ufe0f -12 #grateful #18years #\ud83d\udc9a\ud83d\udc9b Rodgers shouted out his once and future offensive coordinator multiple times, and a new AFC East rival detailed to Yahoo Sports the impact Rodgers could have. Fantasy football analyst Matt Harmon breaks down the long-awaited Aaron Rodgers trade. The Jets will be popular among bettors this season. Charles McDonald, Jori Epstein and Frank Schwab give their instant reactions to news that the Green Bay Packers have traded four-time MVP quarterback Aaron Rodgers to the New York Jets. Everyone likes the trade a lot for the Packers, and hopes Rodgers can take advantage of a loaded Jets roster to perform in year one. The trio also give their thoughts on the recent gambling suspensions given out to five players, including Detroit Lions first-round pick WR Jameson Williams. While the NFL's punishment for players gambling has seemed harsh, it's clear they're making sure they nip it in the bud as sports gambling becomes more popular. Later in the show, the group dive into fixing every AFC team one at a time. The hosts take turns giving one major move each team could make that would improve their odds at contending for a Super Bowl. It's hard to blame the Bears for being glad to see Rodgers go. Wilson\u2019s reclamation could be a part of the broader view of this trade. It's a scenario where Wilson could learn from a player who \u2014 if an understudy can keep up \u2014 has plenty to offer. Don't worry, Jets fans, Aaron Rodgers is still in the team's plans for 2023. Charles Robinson and Charles McDonald take a way-too-early look at the 2023 NFL season by giving their dark horse predictions for AFC and NFC champions, MVP, rushing and receiving leaders and coach of the year. The founder of the cognition testing company has since said reports of the potential top 5 pick's results are \"not true.\" Fantasy football analyst Matt Harmon delivers a special NFL draft edition of his Care/Don't Care column! \"Don't believe everything you read on the internet.\" Dalton Del Don debuts a new fantasy baseball series in which he attempts to point out stats we shouldn't necessarily believe. The Chiefs and many of their fans are steadfast. One protester says she is frequently outside of Arrowhead Stadium before games, often verbally abused by passersby and told to \"go home.\" Jim Boeheim was cleared of all wrongdoing in a fatal 2019 crash that killed Jorge Jimenez. Here's how to watch the NFL Draft in 2023 on ABC, ESPN, ESPN Deportes and NFL Network for free and streaming TV like Fubo, Sling, YouTube, Hulu and more. The new CBA will officially kick in July 1. \u201cI either have to pay to play golf or pay for a place to live.\u201d East Coast basketball fans rejoice. Fantasy baseball analyst Fred Zinkie highlights how to maneuver a trade with every player archetype. Seven years after he went No. 1 overall, Jared Goff may be once again watching the NFL Draft and wondering what his future holds."
