       "author": "Emlyn Travis",
       "title": "Morgan Wallen sued by concertgoer after canceling show minutes before showtime - Entertainment Weekly News",
       "summary": "Country musician Morgan Wallen faced a class-action lawsuit after canceling a performance in Oxford, Mississippi, due to losing his voice. The lawsuit was withdrawn in federal court, but the attorney plans to refile with a new plaintiff. The initial complaint alleged that Wallen broke his own refund terms and attendees were entitled to refunds for out-of-pocket expenses related to the canceled performance.",
       "description": "The class-action lawsuit was subsequently withdrawn in Mississippi federal court, but attorney Casey Lott has pledged to refile.",
       "url": "https://ew.com/music/morgan-wallen-sued-by-concertgoer-after-canceling-show/",
       "urlToImage": "https://imagesvc.meredithcorp.io/v3/mm/image?q=60&c=sc&poi=%5B940%2C266%5D&w=2000&h=1000&url=https%3A%2F%2Fstatic.onecms.io%2Fwp-content%2Fuploads%2Fsites%2F6%2F2023%2F04%2F25%2Fmorgan-wallen-cancelled-show-042523-1.jpg",
       "publishedAt": "2023-04-25T22:27:00Z",
       "content": "Country musician Morgan Wallen could find himself singing the blues.\r\nOn Sunday, the \"Thought You Should Know\" singer suddenly canceled his performance minutes before he was set to perform at the Vau\u2026 [+3089 chars]",
       "full_text": "Country musician Morgan Wallen could find himself singing the blues. On Sunday, the \"Thought You Should Know\" singer suddenly canceled his performance minutes before he was set to perform at the Vaught-Hemingway Stadium in Oxford, Miss., due to losing his voice. The next day, one of the show's attendees sued him for breach of contract and negligence in a class-action lawsuit. The legal saga took another turn Tuesday, when the lawsuit was withdrawn in federal court, but attorney Casey Lott pledged to refile. \"The (first) lawsuit was mistakenly filed based on a misunderstanding. The lawsuit has been dismissed and the case is closed,\" Lott told the Northeast Mississippi Daily Journal. \"We plan to refile the class action lawsuit with a new plaintiff in the coming days.\" Lott could not be reached by EW for immediate comment Tuesday. Representatives for Wallen noted to EW that the lawsuit had been dismissed. According to the initial complaint, the concertgoer alleged that Wallen had broken his own refund terms by canceling the event and that they were \"entitled to refunds of the out-of-pocket expenses they incurred in connection with the canceled performance.\" At Sunday's concert, a large screen announced that Wallen would not be performing and stated that refunds would be available at the point of purchase. However, the plaintiff claimed that all other related purchases should also be covered. \"Even if ticket prices are refunded, no offer has been made to reimburse concertgoers for other out-of-pocket expenses they incurred in connection with the concert cancellation,\" the suit read, \"including transportation, lodging, food, merchandise sales, transaction fees, and other such expenses.\" The complaint also alleged that Wallen had \"assumed a duty to exercise due and reasonable care for the financial property interests of his patrons\" who had spent money to attend the show, including \"ensuring foreseeable cancellations are announced in a timely manner in order to mitigate any damages incurred.\" As a result, the plaintiff was seeking \"money damages in an amount that will fairly and reasonably compensate them for the harm\" caused by Wallen, as well as additional relief for the \"mental anguish\" that they faced in consideration of Wallen's \"willful, reckless and intentional conduct\" at the show. On his Instagram Story on Sunday, Wallen explained that he started losing his voice after Saturday's performance and spent the following day \"resting up, talking to my doctor and working through my vocal exercises trying to get better.\" \"I really thought I'd be able to take the stage and it kills me to deliver this so close to showtime, but my voice is shot and I am unable to sing,\" he continued. \"All tickets will be refunded at point of purchase. I am so sorry, I promise you guys I tried everything I could.\" This isn't the only blunder that has befallen Wallen on tour over the last week. Last Thursday, the 29-year-old took a serious tumble on stage while performing his song \"Heartless\" in Kentucky. [This article has been updated with new information about the lawsuit being dismissed.] Sign up for\u00a0Entertainment Weekly's\u00a0free daily newsletter\u00a0to get breaking TV news, exclusive first looks, recaps, reviews, interviews with your favorite stars, and more Related content:"
