       "summary": "Apple is reportedly developing an AI-powered health coaching service, codenamed Quartz, to help users improve their exercise, eating, and sleeping habits. The service, which will use data from Apple Watches, is expected to come with a monthly fee and be launched next year.",
       "title": "Apple developing AI-powered health coaching service, emotional tracking tools: report - Fox Business",
       "description": "Apple is said to be developing a new A.I.-powered health coaching service to motivate users to exercise as well as new tools to track users' emotional health.",
       "url": "https://www.foxbusiness.com/technology/apple-developing-ai-powered-health-coaching-service-emotional-tracking-tools-report",
       "urlToImage": "https://a57.foxnews.com/static.foxbusiness.com/foxbusiness.com/content/uploads/2023/04/0/0/AI-Health.jpg?ve=1&tl=1",
       "publishedAt": "2023-04-25T21:42:23Z",
       "content": "Apple is reportedly developing an A.I.-powered health coaching service and tools to track the emotional health of users.\u00a0\r\nPeople familiar with the plans told Bloomberg the intent of the coaching ser\u2026 [+1547 chars]",
       "full_text": "\n            Quotes displayed in real-time or delayed by at least 15 minutes. Market data provided by\u00a0Factset.\n            Powered and implemented by\u00a0FactSet Digital Solutions.\u00a0\n            Legal Statement. Mutual Fund and ETF data provided by\u00a0Refinitiv Lipper.\n           This material may not be published, broadcast, rewritten, or redistributed. \u00a92023 FOX News Network, LLC. All rights reserved. FAQ - New Privacy Policy Defiance ETFs CEO and CIO Sylvia Jablonski provides insight on Microsoft's earnings and the impact of AI on 'Making Money.' Apple is reportedly developing an A.I.-powered health coaching service and tools to track the emotional health of users.\u00a0 People familiar with the plans told Bloomberg the intent of the coaching service \u2014 codenamed Quartz \u2014 is to help motivate users to exercise and improve their eating and sleeping habits.\u00a0 FILE: A woman checking an Apple Watch Sport while sitting inside a cafe. (Joseph Branston/Future via Getty Images / Getty Images) The A.I.-powered service will make suggestions and create programs tailored to users\u2019 specific health conditions based on data from an Apple Watch, according to the report. The coaching service is expected to come with a monthly fee.\u00a0 The development comes as the company aims to make health more integral to its products, including an expansion of the health app to the iPad and other features to help with poor vision.\u00a0 A.I. DATA LEAK CRISIS: NEW TOOL PREVENTS COMPANY SECRETS FROM BEING FED TO CHATGPT Per Bloomberg, the project will likely be rolled out next year. In the meantime, Apple users can expect to see an iPad version of the iPhone health app that will show electrocardiogram results and other health data in a larger format.\u00a0 The health app is also expected to offer new tools that track users\u2019 emotions and manage vision conditions. Users will be able to log their mood, answers questions about their day, and evaluate results over time. In the longer term, Apple hopes the mood tracker will rely on algorithms to understand a user\u2019s mood based on their speech, text, and other data.\u00a0 CLICK HERE TO GET THE FOX BUSINESS APP The new iPad app is expected to be unveiled at the Worldwide Developers Conference (WWDC) in June.\u00a0 FOX Business has reached out to Apple for further comment.\u00a0 \n            Quotes displayed in real-time or delayed by at least 15 minutes. Market data provided by\u00a0Factset.\n            Powered and implemented by\u00a0FactSet Digital Solutions.\u00a0\n            Legal Statement. Mutual Fund and ETF data provided by\u00a0Refinitiv Lipper.\n         This material may not be published, broadcast, rewritten, or redistributed. \u00a92023 FOX News Network, LLC. All rights reserved. FAQ - New Privacy Policy"
