       "summary": "Nearly 90 shell casings were found at the scene of the April 15 massacre at a dance studio in Dadeville, Alabama, where four people were killed and 32 others injured. Six defendants have been arrested and a judge has ordered them to be held without bail after new details emerged in court testimony on Tuesday.",
       "description": "The April 15 massacre killed four and injured 32 others.",
