       "content": "Nearly 90 shell casings were found on the floor of the Dadeville, Alabama, dance studio where four people were killed and 32 others were injured this month, according to court testimony on Tuesday.\r\n\u2026 [+1638 chars]",
       "full_text": "The April 15 massacre killed four and injured 32 others. Nearly 90 shell casings were found on the floor of the Dadeville, Alabama, dance studio where four people were killed and 32 others were injured this month, according to court testimony on Tuesday. In a bond hearing for the six defendants, Jess Thornton, a special agent with the Alabama Law Enforcement Agency, revealed new details about the April 15 shooting, which terrorized attendees of a Sweet 16 party and rattled the small Alabama community. A Tallapoosa County official, who was in the courtroom, confirmed to ABC News the contents of Thornton\u2019s testimony, which was recounted in local reports. Thornton said that roughly 50 to 60 people were inside the dance hall at the time of the shooting. At one point, he added, a DJ\u2019s speaker fell over, making a sound similar to a gunshot and prompting several of the partygoers to lift their shirts to show they had guns. An adult told the crowd that anyone over 18 or carrying a gun needed to leave. Soon after, shots rang out. Thornton described how at least two of the defendants were linked to the massacre. He said that one of the defendants, Willie Brown, denied being at the party, but shell casings from an unrelated incident, in which Brown was a suspect, matched a casing found in the dance hall. Another suspect, whom Thornton did not name, was wearing an ankle monitor from an unrelated shooting, whose GPS tracker showed he was in Dadeville. Meanwhile, a gun that was determined to have been fired was found on the chest of Corbin Holston, one of the victims, said Thornton. Following a bond hearing on Wednesday, a judge has ordered the six defendants in the shooting to be held without bail, Tallapoosa County District Attorney Michael Segrest tells ABC News. 24/7 coverage of breaking news and live events"
