       "full_text": "\n                                                            Play Now\n                                                         \nMen's Brackets\n \n                                                            Play Now\n                                                         \nWomen's Brackets\n \nAn NFL Draft Podcast\n \nSee who to add and drop\n The top four QB prospects have headlined the 2023 NFL Draft cycle -- and deservingly so --\u00a0 but in this mock draft, a current top NFL QB is involved in a trade. What if I told you that the San Francisco 49ers traded for Lamar Jackson? In return, the Baltimore Ravens get former No. 3 overall pick Trey Lance, this year's third-round pick (No. 99) and first-rounders in 2024 and 2025. In my first mock draft of the year, I tried to make it as realistic as possible with unexpected surprises and impactful trades. After the Carolina Panthers take Bryce Young at No. 1, my mock heats up with the Houston Texans taking a player no one would have expected weeks ago and the Indianapolis Colts giving their fans either an \"oh no\" or \"oh yes\" moment. And what about the move the Arizona Cardinals made? See, I have you intrigued already.\u00a0 My mock is filled with realistic actions we've all witnessed with past drafts that will keep you locked in until the final selection of the first round. Thanks for checking my mock out. Now let's get to it! For more extensive draft content, check out our latest\u00a0prospect rankings\u00a0and\u00a0mock drafts,\u00a0as well as our NFL Draft podcast,\u00a0\"With the First Pick,\"\u00a0featuring former Vikings general manager Rick Spielman. \u00a9 2004-2023 CBS Interactive. All Rights Reserved. CBS Sports is a registered trademark of CBS Broadcasting Inc. Commissioner.com is a registered trademark of CBS Interactive Inc. Images by Getty Images and US Presswire"
