       "title": "ChatGPT now allows disabling chat history, declining training, and exporting data - Ars Technica",
       "description": "Unsaved chats will be retained 30 days for \"abuse monitoring\" before permanent deletion.",
       "summary": "OpenAI has introduced new controls for ChatGPT users, allowing them to disable chat history and opt out of providing conversation data for AI model training. Additionally, users can now export their chat history for local storage. These changes come after privacy concerns and a bug that exposed some users' chat histories in March.",
       "url": "https://arstechnica.com/information-technology/2023/04/chatgpt-users-can-now-opt-out-of-chat-history-and-model-training/",
       "urlToImage": "https://cdn.arstechnica.net/wp-content/uploads/2023/04/chatgpt_merge-760x380.jpg",
       "publishedAt": "2023-04-25T21:01:17Z",
       "content": "20 with \r\nOn Tuesday, OpenAI announced new controls for ChatGPT users that allow them to turn off chat history, simultaneously opting out of providing that conversation history as data for training A\u2026 [+2445 chars]",
       "full_text": "Front page layout Site theme \nBenj Edwards\n    -  Apr 25, 2023 9:01 pm UTC\n On Tuesday, OpenAI announced new controls for ChatGPT users that allow them to turn off chat history, simultaneously opting out of providing that conversation history as data for training AI models. Also, users can now export chat history for local storage. The new controls, which rolled out to all ChatGPT users today, can be found in ChatGPT settings. Conversations that begin with the chat history disabled won't be used to train and improve the ChatGPT model, nor will they appear in the history sidebar. OpenAI will retain the conversations internally for 30 days and review them \"only when needed to monitor for abuse\" before permanently deleting them. However, users who wish to opt out of providing data to OpenAI for training will lose the conversation history feature. It's unclear why users cannot use conversation history while simultaneously opting out of model training. Previously, ChatGPT kept track of conversations and used the conversation data to fine-tune its AI models. Users could periodically clear their chat history on demand, but any conversation could still be used for fine-tuning. That posed a significant privacy issue, especially for sensitive data that might be shared by corporate employees, lawyers, or doctors using ChatGPT. ChatGPT's conversation history got OpenAI in hot water in March due to a bug that temporarily exposed some ChatGPT users' chat histories to other people. That event attracted regulatory interest in Italy that has not yet been resolved. The new privacy-related ChatGPT features are likely related to the resolution process. Also on Tuesday, OpenAI introduced a new \"export\" option in ChatGPT settings that allows users to export their ChatGPT data to files that can be stored locally on a PC. We tried the export option in ChatGPT Settings (click \"Show\" beside \"Data Controls\") and received an email with a link to a compressed HTML file and several JSON files that contained our stored conversation history with ChatGPT. The history only extended back to the last time we cleared the conversation history. For professionals and enterprises that \"need more control over their data,\" OpenAI also announced that it is working on a new \"ChatGPT Business\" subscription that will opt users out of model training by default, according to OpenAI's Data Controls FAQ. OpenAI says the release date for ChatGPT Business will occur \"in the coming months.\" Join the Ars Orbital Transmission mailing list to get weekly updates delivered to your inbox. \n  CNMN Collection\n  WIRED Media Group\n  \u00a9 2023 Cond\u00e9 Nast. All rights reserved. Use of and/or registration on any portion of this site constitutes acceptance of our User Agreement (updated 1/1/20) and Privacy Policy and Cookie Statement (updated 1/1/20) and Ars Technica Addendum (effective 8/21/2018). Ars may earn compensation on sales from links on this site. Read our affiliate link policy.\nYour California Privacy Rights | Do Not Sell My Personal Information\n  The material on this site may not be reproduced, distributed, transmitted, cached or otherwise used, except with the prior written permission of Cond\u00e9 Nast.\nAd Choices\n"
