       "summary": "Rumer Willis and her partner Derek Richard Thomas have welcomed their first child, Louetta Isely Thomas Willis, making Bruce Willis and Demi Moore grandparents. The baby's birth comes amid the family dealing with Bruce Willis's health struggles after his frontotemporal dementia diagnosis in February.",
